package com.res.bean;public class ResOrders implements java.io.Serializable {	private static final long serialVersionUID = 1L;	private Integer pkId;	private Integer orderNo;	private String orderUser;	private String orderPhone;	private String orderDate;	private String orderMemo;	private String orderFee;		private Integer orderCreatetime;	public Integer getPkId() {		return pkId;	}	public void setPkId(Integer pkId) {		this.pkId = pkId;	}	public Integer getOrderNo() {		return orderNo;	}	public void setOrderNo(Integer orderNo) {		this.orderNo = orderNo;	}	public String getOrderUser() {		return orderUser;	}	public void setOrderUser(String orderUser) {		this.orderUser = orderUser;	}	public String getOrderPhone() {		return orderPhone;	}	public void setOrderPhone(String orderPhone) {		this.orderPhone = orderPhone;	}	public String getOrderDate() {		return orderDate;	}	public void setOrderDate(String orderDate) {		this.orderDate = orderDate;	}	public String getOrderFee() {		return orderFee;	}	public void setOrderFee(String orderFee) {		this.orderFee = orderFee;	}	public Integer getOrderCreatetime() {		return orderCreatetime;	}	public void setOrderCreatetime(Integer orderCreatetime) {		this.orderCreatetime = orderCreatetime;	}	public String getOrderMemo() {		return orderMemo;	}	public void setOrderMemo(String orderMemo) {		this.orderMemo = orderMemo;	}		}